import { FaBars, FaTimes } from "react-icons/fa";
function Navbar() {
  return (
    <header>
      <h3>Logo</h3>
      <nav>
        <a href="/#">Home</a>
        <a href="/#">Conta</a>
        <a href="/#">SIM</a>
        <a href="/#">Clica em mim</a>
        <button>
          <FaTimes />
        </button>

        <button>
          <FaBars />
        </button>
      </nav>
    </header>
  );
}

export default Navbar;
